export const TransactionList = () => {
    return (
        <div>
            <ul>
                <li>Income 1 - 5000</li>
                <li>Income 2 - 1200 </li>
                <li>Expense 1 - 500</li>
                <li>Expense 2 - 500</li>
            </ul>
        </div>
    )
}
